export class VehicleProfile {
  harmanID: string;
  make: string;
  model: string;
  nickName: string;
  year: number;
  iconColor: Colors;
  vehicleType: VehicleTypes;
  vehicleId: string;
  vin: string;
  constructor(vehicleProfile) {
    const details = vehicleProfile.vehicleAttributes;
    this.harmanID = vehicleProfile.harmanID;
    this.make = this.checkDummy(details.make);
    this.model = this.checkDummy(details.model);
    this.nickName = this.checkDummy(details.name);
    this.year = this.checkDummy(details.modelYear);
    this.iconColor = details.baseColor;
    this.vehicleType = details.bodyType;
    this.vehicleId = vehicleProfile.vehicleId;
    this.vin = vehicleProfile.vin;
  }

  private checkDummy = (val) => val !== 'NA' ? val : '';
}
